function find_average_of_array(arr) {
    var array_length = arr.length;
    var start_index = Math.floor(array_length * 0.05);
    var end_index = Math.floor(array_length * 0.95);
    arr.sort((a, b) => (a - b));
    var trimmed_array = arr.slice(start_index, end_index);
    return Number((trimmed_array.reduce((a, b) => a + b) / trimmed_array.length).toFixed(5));
}
```
